#include "Vampire.h"

void Vampire::ClampToScreen()
{
	if (x <= 0)
	{
		x = 0;
		vx = 0;
	}
	if (x + width >= Graphics::ScreenWidth)
	{
		x = Graphics::ScreenWidth - width;
		vx = 0;
	}
	if (y <= 0)
	{
		y = 2;
		vy = 0;
	}
	if (y + height >= Graphics::ScreenHeight)
	{
		y = Graphics::ScreenHeight - height;
	}
}

void Vampire::init(int setx, int sety)
{
	x = float(setx);
	y = float(sety);
}

void Vampire::update(const Keyboard & kbd)
{
	moveControls(kbd);
	if (kbd.KeyIsPressed('E'))
	{
		isScary = true;
	}
	else
	{
		isScary = false;
	}
	//update position.
	x += vx;
	y += vy;
}

void Vampire::draw(Graphics & gfx)
{
	//cvamp.SetR(255);
	//cvamp.SetG(255);
	//cvamp.SetB(255);
	//gfx.Rectangle(int(x), int(y), int(x + width), int(y + height), 2, cvamp);
	if (!isScary)
	{
		if (isSmall)
		{
			if (facingLeft)
			{
				sml_drawLeft(gfx);
			}
			else if (facingRight)
			{
				sml_drawRight(gfx);
			}
			else if (facingUp)
			{
				sml_drawUp(gfx);
			}
			else if (facingDown)
			{
				sml_drawDown(gfx);
			}
		}
	}
	else
	{
		sml_drawScary(gfx);
	}
}

