void Vampire::moveControls(const Keyboard & kbd)
{
	// up down
	if (kbd.KeyIsPressed(VK_UP) || kbd.KeyIsPressed('W'))
	{
		facingLeft = false;
		facingRight = false;
		facingUp = true;
		facingDown = false;
		if (vy > -speed)
		{	//decelerate
			vy -= accel;
		}
	}
	else if (kbd.KeyIsPressed(VK_DOWN) || kbd.KeyIsPressed('S'))
	{
		facingLeft = false;
		facingRight = false;
		facingUp = false;
		facingDown = true;
		if (vy < speed)
		{	//accelerate
			vy += accel;
		}
	}
	else
	{
		if (vy > 0.0f)
		{
			vy -= accel;
		}
		else if (vy < 0.0f)
		{
			vy += accel;
		}
	}
	// left right
	if (kbd.KeyIsPressed(VK_LEFT) || kbd.KeyIsPressed('A'))
	{
		facingLeft = true;
		facingRight = false;
		facingUp = false;
		facingDown = false;
		if (vx > -speed)
		{	//accelerate negative
			vx -= accel;
		}
	}
	else if (kbd.KeyIsPressed(VK_RIGHT) || kbd.KeyIsPressed('D'))
	{
		facingLeft = false;
		facingRight = true;
		facingUp = false;
		facingDown = false;
		if (vx < speed)
		{
			vx += accel;
		}
	}
	else
	{
		//slow down when no key is pressed.
		if (vx > 0.0f)
		{
			vx -= accel;
		}
		else if (vx < 0.0f)
		{
			vx += accel;
		}
	}
}

